          {list.map(item => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>
                <img
                  src="https://api.adorable.io/avatars/50/abott@adorable.png"
                  alt=""
                />
              </td>
              <td>{item.name}</td>
              <td>{item.email}</td>
              <td>
                <button>opcoes</button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </>
  );
}
